import React, { useState } from "react";

const PhoneLocation = () => {
  const [phone, setPhone] = useState("");
  const [location, setLocation] = useState(null);
  const [error, setError] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch(`http://127.0.0.1:8000/get-location/?phone=${phone}`);
      if (!response.ok) {
        throw new Error("Failed to fetch location");
      }
      const data = await response.json();
      if (data.error) {
        throw new Error(data.error);
      }
      setLocation(data);
      setError(null);
    } catch (err) {
      setError(err.message);
      setLocation(null);
    }
  };

  return (
    <div>
      <h1>Phone Number Location Finder</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          value={phone}
          onChange={(e) => setPhone(e.target.value)}
          placeholder="Enter Phone Number"
        />
        <button type="submit">Get Location</button>
      </form>

      {error && <p>Error: {error}</p>}
      {location && (
        <div>
          <p>Country: {location.country || 'Not available'}</p>
          <p>Location: {location.location || 'Not available'}</p>
          <p>Carrier: {location.carrier || 'Not available'}</p>
          <p>Country Code: {location.country_code || 'Not available'}</p>
          <p>Line Type: {location.line_type || 'Not available'}</p>
        </div>
      )}
    </div>
  );
};

export default PhoneLocation;
